require("dotenv").config();
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import "./clickup_api_experimental/get_requests";
import GetTrash from "./clickup_api_experimental/get_requests";
import TaskRequests from "./clickup_api_experimental/task_requests";

function App() {
  return (
    <div className="App">
      <GetTrash />
      <RestoreTask />
      <TaskRequests />
    </div>
  );
}

export default App;
